"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[512],{78784:(t,e,r)=>{r.r(e),r.d(e,{default:()=>s,johnChapter21HI:()=>n});const n={chapter:21,title:"Jean 21",version:"HI",language:"hi",direction:"ltr",verses:[{number:1,text:"\u0907\u0928 \u092c\u093e\u0924\u094b\u0902 \u0915\u0947 \u092c\u093e\u0926 \u092f\u0940\u0936\u0941 \u0928\u0947 \u0905\u092a\u0928\u0947 \u0906\u092a \u0915\u094b \u0924\u093f\u092c\u093f\u0930\u093f\u092f\u093e\u0938 \u0915\u0940 \u091d\u0940\u0932 \u0915\u0947 \u092a\u093e\u0938 \u091a\u0947\u0932\u094b\u0902 \u092a\u0930 \u092b\u093f\u0930 \u092a\u094d\u0930\u0917\u091f \u0915\u093f\u092f\u093e; \u0914\u0930 \u0907\u0938 \u0930\u0940\u0924\u093f \u0938\u0947 \u092a\u094d\u0930\u0917\u091f \u0939\u0941\u0906\u0964",strong:[]},{number:2,text:"\u0936\u092e\u094c\u0928 \u092a\u0924\u0930\u0938 \u0914\u0930 \u0925\u094b\u092e\u093e \u091c\u094b \u0926\u093f\u0926\u0941\u092e\u0941\u0938 \u0915\u0939\u0932\u093e\u0924\u093e \u0939\u0948, \u0914\u0930 \u0917\u0932\u0940\u0932 \u0915\u0947 \u0915\u093e\u0928\u093e \u0915\u0947 \u0928\u0924\u0928\u090f\u0932 \u0914\u0930 \u091c\u092c\u094d\u0926\u0940 \u0915\u0947 \u092a\u0941\u0924\u094d\u0930 \u0914\u0930 \u0909\u0938\u0915\u0947 \u091a\u0947\u0932\u094b\u0902 \u092e\u0947\u0902 \u0938\u0947 \u0926\u094b \u091c\u0928 \u0907\u0915\u091f\u094d\u0920\u0947 \u0925\u0947\u0964",strong:[{text:"Thomas",strong:"G2381",start:14,end:20},{text:"fils",strong:"G5207",start:72,end:76},{text:"deux",strong:"G1417",start:92,end:96}]},{number:3,text:'\u0936\u092e\u094c\u0928 \u092a\u0924\u0930\u0938 \u0928\u0947 \u0909\u0928\u0938\u0947 \u0915\u0939\u093e, "\u092e\u0948\u0902 \u092e\u091b\u0932\u0940 \u092a\u0915\u0921\u093c\u0928\u0947 \u091c\u093e\u0924\u093e \u0939\u0942\u0901\u0964" \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u092e \u092d\u0940 \u0924\u0947\u0930\u0947 \u0938\u093e\u0925 \u091a\u0932\u0924\u0947 \u0939\u0948\u0902\u0964" \u0935\u0947 \u0928\u093f\u0915\u0932\u0947, \u0914\u0930 \u0928\u093e\u0935 \u092a\u0930 \u091a\u0922\u093c\u0947; \u0914\u0930 \u0909\u0938 \u0930\u093e\u0924 \u0915\u0941\u091b \u0928 \u092a\u0915\u0921\u093c\u093e\u0964',strong:[{text:"cher",strong:"G27",start:33,end:37},{text:"avec",strong:"G1848",start:73,end:77},{text:"dans",strong:"H6887",start:110,end:114},{text:"cette",strong:"G3778",start:130,end:135},{text:"nuit",strong:"G3571",start:136,end:140},{text:"rien",strong:"G3762",start:159,end:163}]},{number:4,text:"\u092d\u094b\u0930 \u0939\u094b\u0924\u0947 \u0939\u0940 \u092f\u0940\u0936\u0941 \u0915\u093f\u0928\u093e\u0930\u0947 \u092a\u0930 \u0916\u0921\u093c\u093e \u0939\u0941\u0906; \u0924\u094c\u092d\u0940 \u091a\u0947\u0932\u094b\u0902 \u0928\u0947 \u0928 \u092a\u0939\u091a\u093e\u0928\u093e \u0915\u093f \u0935\u0939 \u092f\u0940\u0936\u0941 \u0939\u0948\u0964",strong:[]},{number:5,text:'\u0924\u092c \u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0928\u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u092c\u093e\u0932\u0915\u094b, \u0915\u094d\u092f\u093e \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092a\u093e\u0938 \u0915\u0941\u091b \u0916\u093e\u0928\u0947 \u0915\u094b \u0939\u0948?" \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0909\u0938\u0915\u094b \u0909\u0924\u094d\u0924\u0930 \u0926\u093f\u092f\u093e, "\u0928\u0939\u0940\u0902\u0964"',strong:[{text:"rien",strong:"G3762",start:37,end:41}]},{number:6,text:'\u0909\u0938\u0928\u0947 \u0909\u0928\u0938\u0947 \u0915\u0939\u093e, "\u0928\u093e\u0935 \u0915\u0947 \u0926\u093e\u0939\u093f\u0928\u0940 \u0913\u0930 \u091c\u093e\u0932 \u0921\u093e\u0932\u094b, \u0924\u094b \u092a\u093e\u0913\u0917\u0947\u0964" \u0924\u092c \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u091c\u093e\u0932 \u0921\u093e\u0932\u093e, \u0914\u0930 \u0905\u092c \u092e\u091b\u0932\u093f\u092f\u094b\u0902 \u0915\u0940 \u092c\u0939\u0941\u0924\u093e\u092f\u0924 \u0915\u0947 \u0915\u093e\u0930\u0923 \u0909\u0938\u0947 \u0916\u0940\u0902\u091a \u0928 \u0938\u0915\u0947\u0964',strong:[]},{number:7,text:'\u0924\u092c \u0909\u0938 \u091a\u0947\u0932\u0947 \u0928\u0947 \u091c\u093f\u0938\u0938\u0947 \u092f\u0940\u0936\u0941 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0925\u093e, \u092a\u0924\u0930\u0938 \u0938\u0947 \u0915\u0939\u093e, "\u092f\u0939 \u0924\u094b \u092a\u094d\u0930\u092d\u0941 \u0939\u0948\u0964" \u0936\u092e\u094c\u0928 \u092a\u0924\u0930\u0938 \u0928\u0947 \u092f\u0939 \u0938\u0941\u0928\u0915\u0930 \u0915\u093f \u092f\u0939 \u092a\u094d\u0930\u092d\u0941 \u0939\u0948, \u0905\u092a\u0928\u093e \u0905\u0901\u0917\u0930\u0916\u093e \u0915\u0938\u0915\u0930 \u092c\u093e\u0901\u0927 \u0932\u093f\u092f\u093e, (\u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0939 \u0928\u0902\u0917\u093e \u0925\u093e) \u0914\u0930 \u091d\u0940\u0932 \u092e\u0947\u0902 \u0915\u0942\u0926 \u092a\u0921\u093c\u093e\u0964',strong:[{text:"disciple",strong:"G3101",start:9,end:17},{text:"Seigneur",strong:"G2962",start:58,end:66},{text:"Seigneur",strong:"G2962",start:122,end:130},{text:"dans",strong:"H6887",start:193,end:197}]},{number:8,text:"\u092a\u0930\u0928\u094d\u0924\u0941 \u0914\u0930 \u091a\u0947\u0932\u0947 \u0928\u093e\u0935 \u092a\u0930, \u092e\u091b\u0932\u093f\u092f\u094b\u0902 \u0938\u0947 \u092d\u0930\u0947 \u0939\u0941\u090f \u091c\u093e\u0932 \u0915\u094b \u0916\u0940\u0902\u091a\u0924\u0947 \u0939\u0941\u090f \u0906\u090f, \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0947 \u0915\u093f\u0928\u093e\u0930\u0947 \u0938\u0947 \u0905\u0927\u093f\u0915 \u0926\u0942\u0930 \u0928\u0939\u0940\u0902, \u092a\u0930\u0928\u094d\u0924\u0941 \u0915\u094b\u0908 \u0926\u094b \u0938\u094c \u0939\u093e\u0925 \u0939\u0940 \u0925\u0947\u0964",strong:[{text:"avec",strong:"G1848",start:29,end:33},{text:"terre",strong:"H776",start:110,end:115},{text:"deux",strong:"G1417",start:130,end:134}]},{number:9,text:"\u091c\u092c \u0915\u093f\u0928\u093e\u0930\u0947 \u092a\u0930 \u0909\u0924\u0930\u0947, \u0924\u094b \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0915\u094b\u092f\u0932\u094b\u0902 \u0915\u0940 \u0906\u0917 \u0914\u0930 \u0909\u0938 \u092a\u0930 \u092e\u091b\u0932\u0940 \u0930\u0916\u0940 \u0939\u0941\u0908, \u0914\u0930 \u0930\u094b\u091f\u0940 \u0926\u0947\u0916\u0940\u0964",strong:[{text:"terre",strong:"H776",start:30,end:35},{text:"pain",strong:"G740",start:98,end:102}]},{number:10,text:'\u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0928\u0938\u0947 \u0915\u0939\u093e, "\u091c\u094b \u092e\u091b\u0932\u093f\u092f\u093e\u0901 \u0924\u0941\u092e \u0928\u0947 \u0905\u092d\u0940 \u092a\u0915\u0921\u093c\u0940 \u0939\u0948\u0902, \u0909\u0928\u092e\u0947\u0902 \u0938\u0947 \u0915\u0941\u091b \u0932\u093e\u0913\u0964"',strong:[{text:"prendre",strong:"G3880",start:56,end:63}]},{number:11,text:"\u0936\u092e\u094c\u0928 \u092a\u0924\u0930\u0938 \u0928\u0947 \u0928\u093e\u0935 \u092a\u0930 \u091a\u0922\u093c\u0915\u0930 \u090f\u0915 \u0938\u094c \u0924\u093f\u0930\u092a\u0928 \u092c\u0921\u093c\u0940 \u092e\u091b\u0932\u093f\u092f\u094b\u0902 \u0938\u0947 \u092d\u0930\u093e \u0939\u0941\u0906 \u091c\u093e\u0932 \u0915\u093f\u0928\u093e\u0930\u0947 \u092a\u0930 \u0916\u0940\u0902\u091a\u093e, \u0914\u0930 \u0907\u0924\u0928\u0940 \u092e\u091b\u0932\u093f\u092f\u093e\u0901 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u091c\u093e\u0932 \u0928\u0939\u0940\u0902 \u092b\u091f\u093e\u0964",strong:[{text:"dans",strong:"H6887",start:19,end:23},{text:"terre",strong:"H776",start:45,end:50}]},{number:12,text:'\u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0928\u0938\u0947 \u0915\u0939\u093e, "\u0906\u0913, \u091c\u0932\u092a\u093e\u0928 \u0915\u0930\u094b\u0964" \u0914\u0930 \u091a\u0947\u0932\u094b\u0902 \u092e\u0947\u0902 \u0938\u0947 \u0915\u093f\u0938\u0940 \u0915\u094b \u092d\u0940 \u092f\u0939 \u0939\u093f\u092f\u093e\u0935 \u0928 \u0939\u0941\u0906 \u0915\u093f \u0909\u0938\u0938\u0947 \u092a\u0942\u091b\u0947, "\u0924\u0942 \u0915\u094c\u0928 \u0939\u0948?" \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0947 \u091c\u093e\u0928\u0924\u0947 \u0925\u0947 \u0915\u093f \u092f\u0939 \u092a\u094d\u0930\u092d\u0941 \u0939\u0948\u0964',strong:[{text:"aucun",strong:"G3762",start:34,end:39},{text:"demander",strong:"G154",start:66,end:74},{text:"Seigneur",strong:"G2962",start:110,end:118}]},{number:13,text:"\u092f\u0940\u0936\u0941 \u0906\u092f\u093e, \u0914\u0930 \u0930\u094b\u091f\u0940 \u0932\u0947\u0915\u0930 \u0909\u0928\u094d\u0939\u0947\u0902 \u0926\u0940, \u0914\u0930 \u0935\u0948\u0938\u0947 \u0939\u0940 \u092e\u091b\u0932\u0940 \u092d\u0940\u0964",strong:[{text:"pain",strong:"G740",start:26,end:30}]},{number:14,text:"\u092f\u0939 \u0905\u092c \u0924\u0940\u0938\u0930\u0940 \u092c\u093e\u0930 \u0939\u0948 \u0915\u093f \u092f\u0940\u0936\u0941 \u092e\u0930\u0947 \u0939\u0941\u0913\u0902 \u092e\u0947\u0902 \u0938\u0947 \u091c\u0940 \u0909\u0920\u0928\u0947 \u0915\u0947 \u092c\u093e\u0926 \u091a\u0947\u0932\u094b\u0902 \u0915\u094b \u0926\u093f\u0916\u093e\u0908 \u0926\u093f\u092f\u093e\u0964",strong:[]},{number:15,text:'\u091c\u092c \u0935\u0947 \u091c\u0932\u092a\u093e\u0928 \u0915\u0930 \u091a\u0941\u0915\u0947, \u0924\u094b \u092f\u0940\u0936\u0941 \u0928\u0947 \u0936\u092e\u094c\u0928 \u092a\u0924\u0930\u0938 \u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u0936\u092e\u094c\u0928, \u092f\u0942\u0939\u0928\u094d\u0928\u093e \u0915\u0947 \u092a\u0941\u0924\u094d\u0930, \u0915\u094d\u092f\u093e \u0924\u0942 \u0907\u0928\u0938\u0947 \u092c\u0922\u093c\u0915\u0930 \u092e\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0948?" \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u093e\u0901 \u092a\u094d\u0930\u092d\u0941; \u0924\u0942 \u091c\u093e\u0928\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0924\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0942\u0901\u0964" \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u092e\u0947\u0930\u0947 \u092e\u0947\u092e\u094d\u0928\u094b\u0902 \u0915\u094b \u091a\u0930\u093e\u0964"',strong:[{text:"fils",strong:"G5207",start:60,end:64},{text:"Seigneur",strong:"G2962",start:138,end:146}]},{number:16,text:'\u0909\u0938\u0928\u0947 \u092b\u093f\u0930 \u0926\u0942\u0938\u0930\u0940 \u092c\u093e\u0930 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u0936\u092e\u094c\u0928, \u092f\u0942\u0939\u0928\u094d\u0928\u093e \u0915\u0947 \u092a\u0941\u0924\u094d\u0930, \u0915\u094d\u092f\u093e \u0924\u0942 \u092e\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0948?" \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u093e\u0901, \u092a\u094d\u0930\u092d\u0941; \u0924\u0942 \u091c\u093e\u0928\u0924\u093e \u0939\u0948, \u0915\u093f \u092e\u0948\u0902 \u0924\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0942\u0901\u0964" \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u092e\u0947\u0930\u0940 \u092d\u0947\u0921\u093c\u094b\u0902 \u0915\u0940 \u0930\u0916\u0935\u093e\u0932\u0940 \u0915\u0930\u0964"',strong:[{text:"fils",strong:"G5207",start:36,end:40},{text:"Seigneur",strong:"G2962",start:89,end:97},{text:"brebis",strong:"G4263",start:146,end:152}]},{number:17,text:'\u0909\u0938\u0928\u0947 \u0924\u0940\u0938\u0930\u0940 \u092c\u093e\u0930 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u0936\u092e\u094c\u0928, \u092f\u0942\u0939\u0928\u094d\u0928\u093e \u0915\u0947 \u092a\u0941\u0924\u094d\u0930, \u0915\u094d\u092f\u093e \u0924\u0942 \u092e\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0948?" \u092a\u0924\u0930\u0938 \u0909\u0926\u093e\u0938 \u0939\u0941\u0906, \u0915\u093f \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0924\u0940\u0938\u0930\u0940 \u092c\u093e\u0930 \u0910\u0938\u093e \u0915\u0939\u093e, "\u0915\u094d\u092f\u093e \u0924\u0942 \u092e\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0948?" \u0914\u0930 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u092a\u094d\u0930\u092d\u0941, \u0924\u0942 \u0924\u094b \u0938\u092c \u0915\u0941\u091b \u091c\u093e\u0928\u0924\u093e \u0939\u0948; \u0924\u0942 \u092f\u0939 \u091c\u093e\u0928\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0924\u0941\u091d \u0938\u0947 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0939\u0942\u0901\u0964" \u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u092e\u0947\u0930\u0940 \u092d\u0947\u0921\u093c\u094b\u0902 \u0915\u094b \u091a\u0930\u093e\u0964',strong:[{text:"fils",strong:"G5207",start:42,end:46},{text:"Seigneur",strong:"G2962",start:171,end:179},{text:"brebis",strong:"G4263",start:251,end:257}]},{number:18,text:'\u092e\u0948\u0902 \u0924\u0941\u091d \u0938\u0947 \u0938\u091a \u0938\u091a \u0915\u0939\u0924\u093e \u0939\u0942\u0901, \u091c\u092c \u0924\u0942 \u091c\u0935\u093e\u0928 \u0925\u093e, \u0924\u092c \u0905\u092a\u0928\u0940 \u0915\u092e\u0930 \u092c\u093e\u0901\u0927\u0915\u0930 \u091c\u0939\u093e\u0901 \u091a\u093e\u0939\u0924\u093e \u0925\u093e, \u0935\u0939\u093e\u0901 \u092b\u093f\u0930\u0924\u093e \u0925\u093e; \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u092c \u0924\u0942 \u092c\u0942\u0922\u093c\u093e \u0939\u094b\u0917\u093e, \u0924\u094b \u0905\u092a\u0928\u0947 \u0939\u093e\u0925 \u0932\u092e\u094d\u092c\u0947 \u0915\u0930\u0947\u0917\u093e, \u0914\u0930 \u0926\u0942\u0938\u0930\u093e \u0924\u0947\u0930\u0940 \u0915\u092e\u0930 \u092c\u093e\u0901\u0927\u0915\u0930 \u091c\u0939\u093e\u0901 \u0924\u0942 \u0928 \u091a\u093e\u0939\u0947\u0917\u093e \u0935\u0939\u093e\u0901 \u0924\u0941\u091d\u0947 \u0932\u0947 \u091c\u093e\u090f\u0917\u093e\u0964"',strong:[]},{number:19,text:'\u0909\u0938\u0928\u0947 \u0907\u0928 \u092c\u093e\u0924\u094b\u0902 \u0938\u0947 \u092a\u094d\u0930\u0917\u091f \u0915\u093f\u092f\u093e, \u0915\u093f \u092a\u0924\u0930\u0938 \u0915\u0948\u0938\u0940 \u092e\u0943\u0924\u094d\u092f\u0941 \u0938\u0947 \u092a\u0930\u092e\u0947\u0936\u094d\u200d\u0935\u0930 \u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u0915\u0930\u0947\u0917\u093e\u0964 \u0914\u0930 \u092f\u0939 \u0915\u0939\u0915\u0930 \u0909\u0938\u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u092e\u0947\u0930\u0947 \u092a\u0940\u091b\u0947 \u0939\u094b \u0932\u0947\u0964"',strong:[{text:"mort",strong:"H6757",start:37,end:41},{text:"Dieu",strong:"G2316",start:62,end:66}]},{number:20,text:'\u092a\u0924\u0930\u0938 \u0928\u0947 \u092b\u093f\u0930\u0915\u0930 \u0909\u0938 \u091a\u0947\u0932\u0947 \u0915\u094b \u092a\u0940\u091b\u0947 \u0906\u0924\u0947 \u0926\u0947\u0916\u093e, \u091c\u093f\u0938\u0938\u0947 \u092f\u0940\u0936\u0941 \u092a\u094d\u0930\u0940\u0924\u093f \u0930\u0916\u0924\u093e \u0925\u093e, \u0914\u0930 \u091c\u093f\u0938\u0928\u0947 \u0930\u093e\u0924 \u0915\u094b \u0909\u0938\u0915\u0940 \u091b\u093e\u0924\u0940 \u0915\u0940 \u0913\u0930 \u091d\u0941\u0915\u0915\u0930 \u092a\u0942\u091b\u093e \u0925\u093e, "\u0939\u0947 \u092a\u094d\u0930\u092d\u0941, \u0924\u0947\u0930\u093e \u092a\u0915\u0921\u093c\u0935\u093e\u0928\u0947\u0935\u093e\u0932\u093e \u0915\u094c\u0928 \u0939\u0948?"',strong:[{text:"disciple",strong:"G3101",start:49,end:57},{text:"Seigneur",strong:"G2962",start:161,end:169}]},{number:21,text:'\u0909\u0938\u0947 \u0926\u0947\u0916\u0915\u0930 \u092a\u0924\u0930\u0938 \u0928\u0947 \u092f\u0940\u0936\u0941 \u0938\u0947 \u0915\u0939\u093e, "\u0939\u0947 \u092a\u094d\u0930\u092d\u0941, \u0907\u0938\u0915\u093e \u0915\u094d\u092f\u093e \u0939\u093e\u0932 \u0939\u094b\u0917\u093e?"',strong:[{text:"Seigneur",strong:"G2962",start:47,end:55}]},{number:22,text:'\u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0938\u0938\u0947 \u0915\u0939\u093e, "\u092f\u0926\u093f \u092e\u0948\u0902 \u091a\u093e\u0939\u0942\u0901 \u0915\u093f \u0935\u0939 \u092e\u0947\u0930\u0947 \u0906\u0928\u0947 \u0924\u0915 \u0920\u0939\u0930\u093e \u0930\u0939\u0947, \u0924\u094b \u0924\u0941\u091d \u0938\u0947 \u0915\u094d\u092f\u093e? \u0924\u0942 \u092e\u0947\u0930\u0947 \u092a\u0940\u091b\u0947 \u0939\u094b \u0932\u0947\u0964"',strong:[{text:"demeure",strong:"H1004",start:32,end:39}]},{number:23,text:'\u0907\u0938 \u0915\u093e\u0930\u0923 \u092d\u093e\u0907\u092f\u094b\u0902 \u092e\u0947\u0902 \u092f\u0939 \u092c\u093e\u0924 \u092b\u0948\u0932 \u0917\u0908, \u0915\u093f \u0935\u0939 \u091a\u0947\u0932\u093e \u0928 \u092e\u0930\u0947\u0917\u093e; \u0924\u094c\u092d\u0940 \u092f\u0940\u0936\u0941 \u0928\u0947 \u0909\u0938\u0938\u0947 \u092f\u0939 \u0928\u0939\u0940\u0902 \u0915\u0939\u093e \u0915\u093f \u0935\u0939 \u0928 \u092e\u0930\u0947\u0917\u093e, \u092a\u0930\u0928\u094d\u0924\u0941 \u092f\u0939 \u0915\u0939\u093e, "\u092f\u0926\u093f \u092e\u0948\u0902 \u091a\u093e\u0939\u0942\u0901 \u0915\u093f \u0935\u0939 \u092e\u0947\u0930\u0947 \u0906\u0928\u0947 \u0924\u0915 \u0920\u0939\u0930\u093e \u0930\u0939\u0947, \u0924\u094b \u0924\u0941\u091d \u0938\u0947 \u0915\u094d\u092f\u093e?"',strong:[{text:"disciple",strong:"G3101",start:51,end:59},{text:"demeure",strong:"H1004",start:168,end:175}]},{number:24,text:"\u092f\u0939 \u0935\u0939\u0940 \u091a\u0947\u0932\u093e \u0939\u0948, \u091c\u094b \u0907\u0928 \u092c\u093e\u0924\u094b\u0902 \u0915\u0940 \u0917\u0935\u093e\u0939\u0940 \u0926\u0947\u0924\u093e \u0939\u0948, \u0914\u0930 \u091c\u093f\u0938\u0928\u0947 \u0907\u0928 \u092c\u093e\u0924\u094b\u0902 \u0915\u094b \u0932\u093f\u0916\u093e \u0939\u0948; \u0914\u0930 \u0939\u092e \u091c\u093e\u0928\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0938\u0915\u0940 \u0917\u0935\u093e\u0939\u0940 \u0938\u091a\u094d\u091a\u0940 \u0939\u0948\u0964",strong:[{text:"disciple",strong:"G3101",start:9,end:17}]},{number:25,text:"\u0914\u0930 \u092d\u0940 \u092c\u0939\u0941\u0924 \u0938\u0947 \u0915\u093e\u092e \u0939\u0948\u0902, \u091c\u094b \u092f\u0940\u0936\u0941 \u0928\u0947 \u0915\u093f\u090f; \u092f\u0926\u093f \u0935\u0947 \u090f\u0915 \u090f\u0915 \u0915\u0930\u0915\u0947 \u0932\u093f\u0916\u0947 \u091c\u093e\u0924\u0947, \u0924\u094b \u092e\u0948\u0902 \u0938\u092e\u091d\u0924\u093e \u0939\u0942\u0901 \u0915\u093f \u092a\u0941\u0938\u094d\u0924\u0915\u0947\u0902 \u091c\u094b \u0932\u093f\u0916\u0940 \u091c\u093e\u0924\u0940\u0902 \u0935\u0947 \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092d\u0940 \u0928 \u0938\u092e\u093e\u0924\u0940\u0902\u0964",strong:[{text:"beaucoup",strong:"G4183",start:20,end:28},{text:"monde",strong:"G2889",start:99,end:104}]}]},s=n}}]);
